import './App.css';

function App() {
  const handleKeyPress = e => {
    console.log("key pressed");
    console.log(e.key);
    if (e.keyCode === 13) {
      console.log("enter key pressed");
    }
  }

  return (
    <div className="App">
      <input
        className="answer"
        onKeyPress={handleKeyPress}
      />
    </div>
  );
}

export default App;
